var Node = (function(){
    function _node(num, char){
        var _this = this;
        if(_this instanceof _node){
            _this.char = char;
            _this.num = num;
        }else{
            return new _node(num,char);
        }
    }
    _node.prototype = {
        constructor: _node,
        type:'Node',
        addLeftNode:function(left){
            this.left = left;
        },
        addRightNode:function(right){
            this.right = right;
        }
    }
    return _node;
})();

var CharMapNum = (function(char){
    function _cmn(char){
        var _this = this;
        if(_this instanceof _cmn){
            _this.num = 0;
            _this.binary = '';
            _this.instance = function(char){
                _this.char = char;
            }(char)
        }else{
            return new _cmn(char);
        }
    }
    _cmn.prototype = {
        constructor: _cmn,
        type:'CharMapNum',
        increase:function(){
            this.num++;
        }
    }
    return _cmn;
})();

var Hfm= (function(){
    function _hfm(){
        var _this = this;
        if(_this instanceof _hfm){
            _this.nodes = [];
            _this.size = 0;
            _this.isMergeNode=function(node1,node2){
                var minNode = _this.nodes[0]||{num:999999};
                return (node1.num<minNode.num&&node2.num<minNode.num)?false:true;
            }
            _this.addNode=function(node){
                _this.nodes.push(node);
            };
            _this.mergeNode=function(node){
                var minNode = _this.nodes[0];
                var newNode = new Node(node.num+minNode.num,'merge');
                _this.nodes[0] = newNode; 
                newNode.addLeftNode(minNode);
                newNode.addRightNode(node);
            }
        }else{
            return new _hfm();
        }
    }
    _hfm.prototype={
        constructor:_hfm,
        type:'Hfm'
    }
    return _hfm;
})();

var CharMapCharAndNum=(function(char){
    function _map( char){
        var _this = this;
        if(_this instanceof _map){
            _this.size=0;
            _this.list = [];
            _this.charnum={};
        }else{
            return new _map(binary,char);
        }
    }
    _map.prototype = {
        constructor: _map,
        type:'CharMapCharAndNum',
        addChar:function(char){
            var cmn = this.charnum[char]||this.newInstanceCharMapNum(char);
            cmn.increase();
            this.charnum[char] =cmn; 
        },
        newInstanceCharMapNum:function(char){
            this.size ++;
            return new CharMapNum(char);
        },
        toList:function(){
            if(this.list.length==0){
                for(i in this.charnum){
                    this.list.push(this.charnum[i]);
                }
            }
            return this.list;
        }
    }
    return _map;
})();

var HfmUtil = {
    int2Binary:function (num){
		var  a;  //获取余数
		var  binary=0; //存储二进制
		var  i=0;  //存储除了几次
		while(num!=0){
			a=num%2;
			num=num/2;
			binary+=a*(Math.pow(10, i));
			i++;
        }
        return binary;
    },
    desc:function(list){
        var tempCMN = {};
        for(var i=0;i<list.length;i++){
            for(var j=i+1;j<list.length;j++){
                if(list[i].num <list[j].num){
                    tempCMN = list[i];
                    list[i] = list[j];
                    list[j] = tempCMN;
                }
            }
        }
        return list;
    },
    asc:function(list){
        var tempCMN = {};
        for(var i=0;i<list.length;i++){
            for(var j=i+1;j<list.length;j++){
                if(list[i].num >list[j].num){
                    tempCMN = list[i];
                    list[i] = list[j];
                    list[j] = tempCMN;
                }
            }
        }
        return list;
    }
};


var NodeController=(function(char){
    var Node = (function(char){
        function _node(char){
            var _this = this;
            if(_this instanceof _node){
                _this.num = 0;
                _this.binary = '';
                _this.instance = function(char){
                    _this.binary = CompressUtil.codeTable[char];
                    _this.char = char;
                }(char)
            }else{
                return new _node(char);
            }
        }
        _node.prototype = {
            constructor: _node,
            type:'Node',
            increase:function(){
                this.num++;
            }
        }
        return _node;
    })();

    function _controller( char){
        var _this = this;
        if(_this instanceof _controller){
            _this.size=0;
            _this.list = [];
            _this.nodeMap={};
        }else{
            return new _controller(binary,char);
        }
    }
    _controller.prototype = {
        constructor: _controller,
        type:'NodeController',
        addChar:function(char){
            var node = this.nodeMap[char]||this.newInstanceNode(char);
            node.increase();
            this.nodeMap[char] =node; 
        },
        newInstanceNode:function(char){
            this.size ++;
            return new Node(char);
        },
        toList:function(){
            if(this.list.length==0){
                for(i in this.nodeMap){
                    this.list.push(this.nodeMap[i]);
                }
            }
            return this.list;
        }
        
    }
    return _controller;
})();


